import React from 'react'
import Logo from '../../img/logo.png'

const LogoSearch = () => {
  return (
    <div className="LogoSearch">
        <img src={Logo} alt=""/>
        <div className="Search">
          <input type="text"/>
        </div>
    </div>

  )
}

export default LogoSearch
